import banner from "../images/icons/banner.svg";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <main>
      {/* md:flex md:justify-start md:items-center */}
      <div className="grid">
        <div className="w-[] bg-gradient-to-bl from-[#C1E8FF] to-[#00266f]">
          <img src={banner} alt="" className="h-64" />
        </div>
        <div className="md:absolute grid text-center justify-center">
          <h1 className="text-[#00266f] text-4xl font-bold pt-5">
            Besoin d'aide?
          </h1>
          <p className="text-[#0b92bd] pb-2">
            Trouver un bricoleur proche de chez vous!
          </p>
          <Link
            to="/"
            className="w-[15rem] relative mx-[120px] text-white bg-[#1057E0] hover:bg-blue-800 outline-none rounded-3xl text-sm px-5 py-2.5 font-bold"
          >
            <button>Trouver un Bricoleur</button>
          </Link>
        </div>
      </div>
    </main>
  );
};

export default Home;
